TXT_CODE_general_start.pidErr:
Wykryto niepowodzenie uruchomienia procesu/kontenera instancji (PID pusty). Możliwe przyczyny:
1. Nieprawidłowa komenda startowa instancji. Sprawdź komendę i parametry w ustawieniach instancji.
2. Nieprawidłowe lub brakujące środowisko hosta, np. brak środowiska Java itp.

Natywna komenda startowa:
{{startCommand}}

Parsowanie komendy startowej:
Program: {{commandExeFile}}
Parametry: {{commandParameters}}

Zgłoś te informacje administratorowi, wsparciu technicznemu lub rozwiąż sam.

